pragma solidity ^0.5.0;

contract VehicleService {
   string vehicleId;
   string vehicleOdometer;
   string vehiclePrice;
   string vehicleTitle;
  
   
   function setVehicleTitle(string memory _vehicleId, string memory _vehicleOdometer,string memory _vehiclePrice,string memory _vehicleTitle) public {
      vehicleId = _vehicleId;
      vehicleOdometer= _vehicleOdometer;
      vehiclePrice = _vehiclePrice;
      vehicleTitle= _vehicleTitle;
      
   }
   
   function getVehicleTitle() public view returns (string memory,string memory,string memory,string memory) {
       return ( vehicleId,vehicleOdometer,vehiclePrice,vehicleTitle);
   
   }
    
}
